import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import { 
  ArrowRight, 
  Code, 
  Cpu, 
  Shield, 
  Wifi, 
  Trophy,
  Calendar,
  Users,
  Zap,
  Terminal,
  GitBranch,
  Database
} from 'lucide-react';
import { CLUB_INFO, DOMAINS } from '../utils/constants';

const Home = () => {
  const techIcons = [
    { Icon: Code, name: 'Development', delay: 0 },
    { Icon: Cpu, name: 'AI/ML', delay: 0.1 },
    { Icon: Shield, name: 'Security', delay: 0.2 },
    { Icon: Wifi, name: 'IoT', delay: 0.3 },
    { Icon: Database, name: 'Blockchain', delay: 0.4 },
    { Icon: Terminal, name: 'DevOps', delay: 0.5 }
  ];

  const stats = [
    { number: '500+', label: 'Active Members', Icon: Users },
    { number: '50+', label: 'Projects Built', Icon: GitBranch },
    { number: '25+', label: 'Hackathons Won', Icon: Trophy },
    { number: '100+', label: 'Events Hosted', Icon: Calendar }
  ];

  return (
    <div className="min-h-screen bg-gray-950">
      {/* Hero Section */}
      <section className="relative overflow-hidden">
        {/* Animated background */}
        <div className="absolute inset-0 matrix-bg opacity-20"></div>

        {/* Floating tech elements */}
        <div className="absolute inset-0 overflow-hidden pointer-events-none">
          {techIcons.map(({ Icon, delay }, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 0.1, y: 0 }}
              transition={{ delay: delay + 1, duration: 1 }}
              className="absolute animate-float text-cyan-500"
              style={{
                left: `${10 + index * 15}%`,
                top: `${20 + (index % 2) * 30}%`,
                animationDelay: `${delay}s`
              }}
            >
              <Icon size={60} />
            </motion.div>
          ))}
        </div>

        <div className="relative z-10 section-padding">
          <div className="container-max">
            <div className="text-center max-w-4xl mx-auto">
              <motion.div
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.8 }}
                className="space-y-8"
              >
                {/* Main heading */}
                <div className="space-y-4">
                  <h1 className="text-5xl md:text-7xl font-bold text-white leading-tight">
                    Welcome to{' '}
                    <span className="text-gradient block mt-2">
                      {CLUB_INFO.name}
                    </span>
                  </h1>
                  <p className="text-xl md:text-2xl text-gray-400 max-w-3xl mx-auto leading-relaxed">
                    {CLUB_INFO.tagline}
                  </p>
                </div>

                {/* Tech domains showcase */}
                <motion.div
                  initial={{ opacity: 0, y: 20 }}
                  animate={{ opacity: 1, y: 0 }}
                  transition={{ delay: 0.3, duration: 0.8 }}
                  className="flex flex-wrap justify-center gap-4 mt-8"
                >
                  {['Machine Learning', 'IoT', 'Blockchain', 'Cyber Security'].map((domain, index) => (
                    <span
                      key={domain}
                      className="px-4 py-2 bg-gray-800/50 border border-gray-700 rounded-full text-cyan-400 code-font text-sm backdrop-blur-sm"
                    >
                      {domain}
                    </span>
                  ))}
                </motion.div>

                {/* CTA Buttons */}
                <motion.div
                  initial={{ opacity: 0, y: 20 }}
                  animate={{ opacity: 1, y: 0 }}
                  transition={{ delay: 0.6, duration: 0.8 }}
                  className="flex flex-col sm:flex-row gap-4 justify-center mt-12"
                >
                  <Link to="/contact" className="btn-primary group">
                    <span className="flex items-center">
                      Join the Club
                      <ArrowRight size={18} className="ml-2 group-hover:translate-x-1 transition-transform duration-200" />
                    </span>
                  </Link>
                  <Link to="/projects" className="btn-outline group">
                    <span className="flex items-center">
                      <Terminal size={18} className="mr-2" />
                      Explore Projects
                    </span>
                  </Link>
                </motion.div>
              </motion.div>
            </div>
          </div>
        </div>
      </section>

      {/* Stats Section */}
      <section className="section-padding bg-gray-900/50">
        <div className="container-max">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
            className="grid grid-cols-2 md:grid-cols-4 gap-8"
          >
            {stats.map(({ number, label, Icon }, index) => (
              <motion.div
                key={label}
                initial={{ opacity: 0, y: 20 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ delay: index * 0.1, duration: 0.6 }}
                viewport={{ once: true }}
